const orderJsonKeys = (jsonObj) => {
  const ordered = {};
  Object.keys(jsonObj).sort().forEach(key => {
    ordered[key] = jsonObj[key];
  });
  return ordered;
}

// Check if file returned with content
if (Object.keys($input.all()[0].json).includes("content")) {
  // Decode base64 content and parse JSON
  const origWorkflow = JSON.parse(Buffer.from($input.all()[0].json.content, 'base64').toString());
  const n8nWorkflow = $input.all()[1].json;

  // Order JSON objects
  const orderedOriginal = orderJsonKeys(origWorkflow);
  const orderedActual = orderJsonKeys(n8nWorkflow);

  // Determine difference
  if (JSON.stringify(orderedOriginal) === JSON.stringify(orderedActual)) {
    $input.all()[0].json.github_status = "same";
  } else {
    $input.all()[0].json.github_status = "different";
    $input.all()[0].json.n8n_data_stringy = JSON.stringify(orderedActual, null, 2);
  }
  $input.all()[0].json.content_decoded = orderedOriginal;
// No file returned / new workflow
} else if (Object.keys($input.all()[0].json).includes("data")) {
  const origWorkflow = JSON.parse($input.all()[0].json.data);
  const n8nWorkflow = $input.all()[1].json;

  // Order JSON objects
  const orderedOriginal = orderJsonKeys(origWorkflow);
  const orderedActual = orderJsonKeys(n8nWorkflow);

  // Determine difference
  if (JSON.stringify(orderedOriginal) === JSON.stringify(orderedActual)) {
    $input.all()[0].json.github_status = "same";
  } else {
    $input.all()[0].json.github_status = "different";
    $input.all()[0].json.n8n_data_stringy = JSON.stringify(orderedActual, null, 2);
  }
  $input.all()[0].json.content_decoded = orderedOriginal;

} else {
  // Order JSON object
  const n8nWorkflow = $input.all()[1].json;
  const orderedActual = orderJsonKeys(n8nWorkflow);

  // Proper formatting
  $input.all()[0].json.github_status = "new";
  $input.all()[0].json.n8n_data_stringy = JSON.stringify(orderedActual, null, 2);
}

// Return items
return $input.all();

// Obtém o primeiro item do fluxo
const item = $input.first();

// Garante que há dados na entrada
if (!item || !item.json || !item.json.output) {
  throw new Error("A chave 'output' não foi encontrada no JSON de entrada.");
}

// Processa o texto removendo todas as quebras de linha e emojis
const textoEntrada = item.json.output; // Use a chave correta para pegar o texto de entrada

// Remove quebras de linha (\n)
let textoProcessado = textoEntrada.replace(/\n/g, "");

// Remove emojis
textoProcessado = textoProcessado.replace(
  /[\u{1F600}-\u{1F64F}]|[\u{1F300}-\u{1F5FF}]|[\u{1F680}-\u{1F6FF}]|[\u{1F700}-\u{1F77F}]|[\u{1F780}-\u{1F7FF}]|[\u{1F800}-\u{1F8FF}]|[\u{1F900}-\u{1F9FF}]|[\u{1FA00}-\u{1FA6F}]|[\u{1FA70}-\u{1FAFF}]|[\u{2600}-\u{26FF}]|[\u{2700}-\u{27BF}]|[\u{FE00}-\u{FE0F}]|[\u{1F1E0}-\u{1F1FF}]/gu,
  ""
);

// Retorna o resultado
return {
  textoOriginal: textoEntrada,
  textoSemQuebrasNemEmojis: textoProcessado,
};

return $items("Set File ID").map(item => {
